import React from "react";
import ReactDOM from "react-dom";
import Block from "./block";

export default class BigDisplay extends React.Component {
  state = { allColour: -1 };

  constructor(props) {
    super(props);
    this.state.allColour = props.colour;
  }
  render() {
    return (
      <div>
        {console.log(this.state.allColour)}
        <div>
          <Block colour={this.state.allColour} />
          <Block colour={this.state.allColour} />
          <Block colour={this.state.allColour} />
        </div>
        <div>
          <Block colour={this.state.allColour} />
          <Block colour={this.state.allColour} />
          <Block colour={this.state.allColour} />
        </div>
        <div>
          <Block colour={this.state.allColour} />
          <Block colour={this.state.allColour} />
          <Block colour={this.state.allColour} />
        </div>
      </div>
    );
  }
}

class NetLayout extends React.Component {
  render() {
    return <BigDisplay colour="2" />;
  }
}
ReactDOM.render(<BigDisplay colour="2" />, document.getElementById("root"));
